import "./styles.css";

function App() {
    return (
        <div className="App">
            <div className="row no-gutters">
                <div
                    className="col no-gutters"
                    style={{
                        backgroundImage: `url("wallpaper.jpg")`,
                        backgroundSize: "cover",
                    }}
                >
                    <div className="leftside-title">
                        <p style={{ fontSize: "28px" }}>Bonjour Ã  tous</p>
                        <p style={{ fontSize: "18px" }}>
                            Bienvenue sur Lamster !
                        </p>
                    </div>
                    <div className="social-link-footer">
                        <img
                            className="social-link-icon "
                            style={{
                                width: "20px",
                                height: "3Opx",
                            }}
                            src="twitter.svg"
                            alt="display image"
                        />
                        <img
                            className="social-link-icon "
                            style={{
                                width: "20px",
                                height: "3Opx",
                            }}
                            src="facebook.svg"
                            alt="display image"
                        />
                        <img
                            className="social-link-icon "
                            style={{
                                width: "20px",
                                height: "3Opx",
                            }}
                            src="instagram.svg"
                            alt="display image"
                        />
                    </div>
                </div>
                <div className="col no-gutters">
                    <div className="rightside">
                        <div
                            style={{
                                color: "white",
                                margin: "15px",
                                float: "right",
                            }}
                        >
                            S'inscrire
                        </div>
                        <div className="form">
                            <div>
                                <img
                                    className="social-link-icon "
                                    style={{
                                        width: "200px",
                                        height: "30Opx",
                                        margin: "auto",
                                        display: "block",
                                    }}
                                    src="brand_name.svg"
                                    alt="display image"
                                />
                            </div>
                        </div>
                    </div>
                </div>
            </div>
        </div>
    );
}

export default App;
